import Layout from "../components/Layout";

const Home = props => {
  return (
    <Layout>
      <div className=" home no-main-padding d-flex justify-center"></div>
      <img className="paint" src="/images/paint1.jpg" alt="" />
      <style jsx>
        {`
          .home {
            background-image: url("/images/home5-empty.png");
            background-size: cover;
            background-position: center;
            height: calc(100vh - 160px);
            width: calc(100vw - 40px);
            position: fixed;
            top: 140px;
          }
          .paint-container {
            position: relative;
            width: 323px;
            height: 323px;
            top: 20%;

            margin-left: 60px;
            border-radius: 3px;
          }
          .canvas {
            width: 323px;
            height: 323px;
            position: absolute;
            top: 0;
            box-shadow: 0px 10px 8px 2px #aa967d;
          }
          .paint {
            width: 323px;
            height: 323px;
            position: absolute;
            top: 0;
            opacity: 0;
            transition: 0.2s;
            border-radius: 3px;
          }
          .paint:hover {
            opacity: 1;
            transition: 0.2s;
          }
        `}
      </style>
    </Layout>
  );
};

export default Home;
